import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function FreelancerDashboard() {
  const [proposals, setProposals] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const token = localStorage.getItem("token");
  const freelancerId = localStorage.getItem("userId");

  useEffect(() => {
    if (!token) {
      setError("You are not logged in!");
      setLoading(false);
      return;
    }

    const fetchProposals = async () => {
      try {
        const response = await axios.get(
          `http://localhost:8080/proposal/freelancer/${freelancerId}`,
          { headers: { Authorization: `Bearer ${token}` } }
        );

        const enriched = await Promise.all(
          response.data.map(async (proposal) => {
            const projectRes = await axios.get(
              `http://localhost:8080/projects/${proposal.projectId}`,
              { headers: { Authorization: `Bearer ${token}` } }
            );
            return { ...proposal, project: projectRes.data };
          })
        );

        const sorted = enriched.sort((a, b) => {
          const order = { ACCEPTED: 0, REJECTED: 1, PENDING: 2 };
          return order[a.status] - order[b.status];
        });

        setProposals(sorted);
      } catch (err) {
        console.error(err.response || err);
        setError("Error fetching proposals.");
      } finally {
        setLoading(false);
      }
    };

    fetchProposals();
  }, [token, freelancerId]);

  const deleteProposal = async (proposalId) => {
    if (!window.confirm("Are you sure you want to delete this proposal?")) return;

    try {
      await axios.delete(`http://localhost:8080/proposal/${proposalId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setProposals((prev) => prev.filter((p) => p.id !== proposalId));
    } catch (err) {
      console.error(err.response || err);
      alert("Failed to delete proposal.");
    }
  };

  if (loading) return <p>Loading proposals...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>My Projects</h2>
      {proposals.length === 0 ? (
        <p>No proposals submitted yet.</p>
      ) : (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {proposals.map((proposal) => (
            <li
              key={proposal.id}
              style={{
                marginBottom: "15px",
                border: "1px solid #ccc",
                padding: "10px",
                borderRadius: "5px",
              }}
            >
              <h3>{proposal.project.title}</h3>
              <p><strong>Description:</strong> {proposal.project.description}</p>
              <p>
                <strong>Budget:</strong> {proposal.project.minBudget} - {proposal.project.maxBudget}
              </p>
              <p>
                <strong>Deadline:</strong>{" "}
                {new Date(proposal.project.deadline).toLocaleDateString()}
              </p>
              <p><strong>Skills:</strong> {proposal.project.skills.join(", ")}</p>
              <p><strong>Bid Amount:</strong> {proposal.bidAmount}</p>
              <p><strong>Status:</strong> {proposal.status}</p>

              <div style={{ display: "flex", gap: "10px", marginTop: "10px" }}>
                {proposal.status === "ACCEPTED" && (
                  <>
                    <button
                      style={{
                        padding: "6px 12px",
                        backgroundColor: "#007bff",
                        color: "white",
                        border: "none",
                        borderRadius: "4px",
                        cursor: "pointer",
                      }}
                      onClick={() => navigate(`/milestones/${proposal.projectId}`)}
                    >
                      View More
                    </button>

                    <button
                      style={{
                        padding: "6px 12px",
                        backgroundColor: "green",
                        color: "white",
                        border: "none",
                        borderRadius: "4px",
                        cursor: "pointer",
                      }}
                      onClick={() => navigate(`/contracts/create?proposalId=${proposal.id}`)}
                    >
                      Create Contract
                    </button>
                  </>
                )}

                {proposal.status === "PENDING" && (
                  <button
                    style={{
                      padding: "6px 12px",
                      backgroundColor: "red",
                      color: "white",
                      border: "none",
                      borderRadius: "4px",
                      cursor: "pointer",
                    }}
                    onClick={() => deleteProposal(proposal.id)}
                  >
                    Delete Proposal
                  </button>
                )}
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
